member.example:
This sample shows how to call TwoAsync and parse the result.

var endpoint = new Uri("<https://my-service.azure.com>");
var client = new TeamServiceClient(endpoint);

Response response = await client.TwoAsync();

JsonElement result = JsonDocument.Parse(response.ContentStream).RootElement;
Console.WriteLine(result.ToString());

This sample shows how to call Two and parse the result.

var endpoint = new Uri("<https://my-service.azure.com>");
var client = new TeamServiceClient(endpoint);

Response response = client.Two();

JsonElement result = JsonDocument.Parse(response.ContentStream).RootElement;
Console.WriteLine(result.ToString());
